import React from "react";
import MainVideo from "../assets/Walking Girl.mp4";
import styled from "styled-components";

const VideoContainer = styled.section`
	width: 100%;
	height: 100vh;
	position: relative;
`;

const CoverVideo = () => {
	return (
		<VideoContainer>
			<video src={MainVideo} controls></video>
		</VideoContainer>
	);
};

export default CoverVideo;
